import React, { useEffect, useState } from 'react'
import '../styles/Exercises.css'
import Header from './Header'

const Exercises = ({ API_URL }) => {
  const [exercises, setExercises] = useState([])

  useEffect(() => {
    const getExercises = async () => {
      const res = await fetch(`${API_URL}/exercises`)
      const data = await res.json()

      setExercises(data)
    }

    getExercises()
  }, [API_URL])

  return (
    <div className='page-body'>
      <Header placeholder='ejercicio' title='Ejercicios' path='new-exercise' />

      {exercises?.length > 0 ? (
        <div className=''>
          {
            exercises.map(exercise => (
              <div className='exercise'>
                <label key={exercise.id} className='list-group-item rounded-3 py-3'>
                  {exercise.fullName}
                  <span className='d-block small opacity-50'>Some other text goes here</span>
                </label>
                <i class="bi bi-trash3-fill"></i>
              </div>
            ))
          }
        </div>
        ) : (
          <h1>
            No se han encontrado ejercicios
          </h1>
        )
      }
    </div>
  )
}

export default Exercises
